INSERT INTO `v1_28a7c94b4e6a23f6522c35c0bc53cedc113bb85ae72dd121ce3ed551622fc0ca` VALUES (1, 7, 0, -363.0, 1, 1, 106001, "2030/12/17 14:59:59", "2015/12/17 15:00:00", 0, "たまには\n協力するのもいいんじゃない？\nあたしも手を貸してあげる", 0.0, "キャル", 7001, 0.0);
INSERT INTO `v1_28a7c94b4e6a23f6522c35c0bc53cedc113bb85ae72dd121ce3ed551622fc0ca` VALUES (1, 7, 0, -363.0, 1, 1, 105901, "2030/12/17 14:59:59", "2015/12/17 15:00:00", 0, "多くの方と協力して\n戦えるようです\n主さまなら、さぞ\nご活躍なさることでしょう", 0.0, "コッコロ", 7002, 0.0);
INSERT INTO `v1_28a7c94b4e6a23f6522c35c0bc53cedc113bb85ae72dd121ce3ed551622fc0ca` VALUES (1, 7, 0, -363.0, 1, 1, 105801, "2030/12/17 14:59:59", "2015/12/17 15:00:00", 0, "たくさんの人と一緒に\n協力バトルです！\nがんばりましょう☆", 0.0, "ペコリーヌ", 7003, 0.0);
INSERT INTO `v1_28a7c94b4e6a23f6522c35c0bc53cedc113bb85ae72dd121ce3ed551622fc0ca` VALUES (1, 10, 0, -363.0, 1, 1, 105801, "2030/12/17 14:59:59", "2015/12/17 15:00:00", 0, "ジュエルを食べ物…\nいえ、貴重品と交換できます！", 0.0, "ペコリーヌ", 10001, 0.0);
INSERT INTO `v1_28a7c94b4e6a23f6522c35c0bc53cedc113bb85ae72dd121ce3ed551622fc0ca` VALUES (1, 10, 0, -363.0, 1, 1, 106001, "2030/12/17 14:59:59", "2015/12/17 15:00:00", 0, "ジュエルはよく考えて\n使うことね\n無駄遣い厳禁！", 0.0, "キャル", 10002, 0.0);
INSERT INTO `v1_28a7c94b4e6a23f6522c35c0bc53cedc113bb85ae72dd121ce3ed551622fc0ca` VALUES (1, 10, 0, -363.0, 1, 1, 105901, "2030/12/17 14:59:59", "2015/12/17 15:00:00", 0, "主さまのジュエルで\n貴重な品々を購入できます\nですが、無駄遣いは\n『めっ』でございますよ", 0.0, "コッコロ", 10003, 0.0);
INSERT INTO `v1_28a7c94b4e6a23f6522c35c0bc53cedc113bb85ae72dd121ce3ed551622fc0ca` VALUES (1, 10, 2104010, -363.0, 1, 2, 106401, "2030/12/17 14:59:59", "2015/12/17 15:00:00", 0, "ジュエルがあれば\n貴重品と交換できるみたい\n大事に使いましょうね", 0.0, "シェフィ", 10004, 0.0);
INSERT INTO `v1_28a7c94b4e6a23f6522c35c0bc53cedc113bb85ae72dd121ce3ed551622fc0ca` VALUES (1, 12, 0, -416.5, 1, 1, 105801, "2030/12/17 14:59:59", "2015/12/17 15:00:00", 0, "特定の条件を達成すると\n報酬がもらえますよ！\nがんばりましょう♪　", 0.0, "ペコリーヌ", 12001, 0.0);
INSERT INTO `v1_28a7c94b4e6a23f6522c35c0bc53cedc113bb85ae72dd121ce3ed551622fc0ca` VALUES (1, 13, 0, -363.0, 1, 1, 106001, "2030/12/17 14:59:59", "2015/12/17 15:00:00", 0, "思い出が詰まってるって\nいろいろあったけど\n振り返るのもいいんじゃない？", 0.0, "キャル", 13001, 0.0);
INSERT INTO `v1_28a7c94b4e6a23f6522c35c0bc53cedc113bb85ae72dd121ce3ed551622fc0ca` VALUES (1, 13, 0, -363.0, 1, 1, 105901, "2030/12/17 14:59:59", "2015/12/17 15:00:00", 0, "主さまとの楽しい日々…\nこちらで何度でも\n思い返しましょう♪", 0.0, "コッコロ", 13002, 0.0);
INSERT INTO `v1_28a7c94b4e6a23f6522c35c0bc53cedc113bb85ae72dd121ce3ed551622fc0ca` VALUES (1, 13, 2104010, -363.0, 1, 2, 106401, "2030/12/17 14:59:59", "2015/12/17 15:00:00", 0, "みんなとの大切な思い出が\nたくさん詰まってるのね\n一緒に振り返って、\n心に刻みたいわ", 0.0, "シェフィ", 13003, 0.0);
INSERT INTO `v1_28a7c94b4e6a23f6522c35c0bc53cedc113bb85ae72dd121ce3ed551622fc0ca` VALUES (1, 13, 0, -363.0, 1, 1, 105801, "2030/12/17 14:59:59", "2015/12/17 15:00:00", 0, "女の子との思い出が\nたくさん見られますよ！\nヒューヒュー♪\nモテモテですねー☆", 0.0, "ペコリーヌ", 13004, 0.0);
INSERT INTO `v1_28a7c94b4e6a23f6522c35c0bc53cedc113bb85ae72dd121ce3ed551622fc0ca` VALUES (1, 14, 0, -363.0, 1, 1, 105901, "2030/12/17 14:59:59", "2015/12/17 15:00:00", 0, "育成に必要なアイテムが\n獲得できるクエストです\nわたくし、主さまのために、\n強くなりますよ", 0.0, "コッコロ", 14001, 0.0);
INSERT INTO `v1_28a7c94b4e6a23f6522c35c0bc53cedc113bb85ae72dd121ce3ed551622fc0ca` VALUES (1, 14, 2104010, -363.0, 1, 2, 106401, "2030/12/17 14:59:59", "2015/12/17 15:00:00", 0, "このクエストを攻略すると、\nアイテムが手に入るらしいわ。\nもっと強くなるために、\n一生懸命がんばるわね！", 0.0, "シェフィ", 14002, 0.0);
INSERT INTO `v1_28a7c94b4e6a23f6522c35c0bc53cedc113bb85ae72dd121ce3ed551622fc0ca` VALUES (1, 14, 0, -363.0, 1, 1, 105801, "2030/12/17 14:59:59", "2015/12/17 15:00:00", 0, "このクエストを攻略すれば、\nアイテムがもらえますよ\nたくさん集めて、どんどん\n強くなっちゃいましょう！", 0.0, "ペコリーヌ", 14003, 0.0);
INSERT INTO `v1_28a7c94b4e6a23f6522c35c0bc53cedc113bb85ae72dd121ce3ed551622fc0ca` VALUES (1, 14, 0, -363.0, 1, 1, 106001, "2030/12/17 14:59:59", "2015/12/17 15:00:00", 0, "クエストを攻略すると、\nアイテムが手に入るんだって\nもらえるものは、\nもらっておきましょ！", 0.0, "キャル", 14004, 0.0);
INSERT INTO `v1_28a7c94b4e6a23f6522c35c0bc53cedc113bb85ae72dd121ce3ed551622fc0ca` VALUES (1, 15, 0, -470.0, 1, 1, 105901, "2030/12/17 14:59:59", "2015/12/17 15:00:00", 0, "主さま、旅の準備を整えて\nより充実した冒険をいたし\nましょう", 0.0, "コッコロ", 15001, 0.0);
INSERT INTO `v1_28a7c94b4e6a23f6522c35c0bc53cedc113bb85ae72dd121ce3ed551622fc0ca` VALUES (1, 16, 2104010, -363.0, 1, 2, 106401, "2030/12/17 14:59:59", "2015/12/17 15:00:00", 0, "ねぇ…クランに加入してみない？\n一人も楽しいけど、みんなと\n一緒も賑やかでいいと思うの", 0.0, "シェフィ", 16001, 0.0);
INSERT INTO `v1_28a7c94b4e6a23f6522c35c0bc53cedc113bb85ae72dd121ce3ed551622fc0ca` VALUES (1, 16, 0, -363.0, 1, 1, 105801, "2030/12/17 14:59:59", "2015/12/17 15:00:00", 0, "クランに加入してみませんか？\nみんなといっしょに冒険した方が、\n楽しいですよ！", 0.0, "ペコリーヌ", 16002, 0.0);
INSERT INTO `v1_28a7c94b4e6a23f6522c35c0bc53cedc113bb85ae72dd121ce3ed551622fc0ca` VALUES (1, 16, 0, -363.0, 1, 1, 106001, "2030/12/17 14:59:59", "2015/12/17 15:00:00", 0, "クランに入れるらしいわよ\nせっかくだから入ってみたら？\nけっこう楽しいみたいよ♪", 0.0, "キャル", 16003, 0.0);
INSERT INTO `v1_28a7c94b4e6a23f6522c35c0bc53cedc113bb85ae72dd121ce3ed551622fc0ca` VALUES (1, 16, 0, -363.0, 1, 1, 105901, "2030/12/17 14:59:59", "2015/12/17 15:00:00", 0, "こちらでクランに加入できます\n素敵なクランがたくさんあって、\n目移りしてしまいますね", 0.0, "コッコロ", 16004, 0.0);
INSERT INTO `v1_28a7c94b4e6a23f6522c35c0bc53cedc113bb85ae72dd121ce3ed551622fc0ca` VALUES (1, 17, 0, -363.0, 1, 1, 105901, "2030/12/17 14:59:59", "2015/12/17 15:00:00", 0, " こちらではクランバトルに\n 参加された仲間のみなさんの\n 活躍を振り返ることができます", 0.0, "コッコロ", 17002, 0.0);
INSERT INTO `v1_28a7c94b4e6a23f6522c35c0bc53cedc113bb85ae72dd121ce3ed551622fc0ca` VALUES (1, 25, 0, -363.0, 1, 1, 106001, "2030/12/17 14:59:59", "2015/12/17 15:00:00", 0, "模擬戦の戦績もアンタが\n気に入ったものがあれば\n記録しておけるのね", 0.0, "キャル", 17004, 0.0);
INSERT INTO `v1_28a7c94b4e6a23f6522c35c0bc53cedc113bb85ae72dd121ce3ed551622fc0ca` VALUES (1, 25, 0, -363.0, 1, 1, 105901, "2030/12/17 14:59:59", "2015/12/17 15:00:00", 0, "主さま、今回のクランバトルでの\nご活躍が記録されています\nバトルの参考にいたしましょう", 0.0, "コッコロ", 17005, 0.0);
INSERT INTO `v1_28a7c94b4e6a23f6522c35c0bc53cedc113bb85ae72dd121ce3ed551622fc0ca` VALUES (1, 25, 2104010, -363.0, 1, 2, 106401, "2030/12/17 14:59:59", "2015/12/17 15:00:00", 0, "今回のクランバトルの調子は\nどうかしら？\n戦績を見れば、次のバトルに\n活かせるかもしれないわ", 0.0, "シェフィ", 17006, 0.0);
INSERT INTO `v1_28a7c94b4e6a23f6522c35c0bc53cedc113bb85ae72dd121ce3ed551622fc0ca` VALUES (1, 25, 0, -363.0, 1, 1, 105801, "2030/12/17 14:59:59", "2015/12/17 15:00:00", 0, "今回のクランバトルでの戦績を\nおさらいできますよ！\n私にも見せてください☆", 0.0, "ペコリーヌ", 17007, 0.0);
INSERT INTO `v1_28a7c94b4e6a23f6522c35c0bc53cedc113bb85ae72dd121ce3ed551622fc0ca` VALUES (1, 18, 0, -363.0, 1, 1, 190801, "2030/12/17 14:59:59", "2015/12/17 15:00:00", 0, "ようこそ！\nこちらでは、\nギルドハウスで流れる音楽の\n変更や購入が出来ますよ", 0.0, "カリン", 18001, 0.0);
