INSERT INTO `v1_28a7c94b4e6a23f6522c35c0bc53cedc113bb85ae72dd121ce3ed551622fc0ca` VALUES (3, 19, 0, -470.0, 1, 1, 190801, "2030/12/17 14:59:59", "2015/12/17 15:00:00", 0, "ギルドハウスの\nＢＧＭを変更できますよ\nあなたの好きな曲、\n私にも聴かせてくださいね", 0.0, "カリン", 19001, 0.0);
INSERT INTO `v1_28a7c94b4e6a23f6522c35c0bc53cedc113bb85ae72dd121ce3ed551622fc0ca` VALUES (4, 19, 0, -470.0, 1, 1, 190801, "2030/12/17 14:59:59", "2015/12/17 15:00:00", 0, "こちらでは、ＢＧＭの変更が\nできますよ\nどんな曲に変更しますか？\nふふふ、私も楽しみです♪", 0.0, "カリン", 19002, 0.0);
INSERT INTO `v1_28a7c94b4e6a23f6522c35c0bc53cedc113bb85ae72dd121ce3ed551622fc0ca` VALUES (5, 20, 0, -470.0, 1, 1, 190801, "2030/12/17 14:59:59", "2015/12/17 15:00:00", 0, "こちらでは、ＢＧＭを購入\nすることができますよ\n試聴することもできるので、\nじっくり選んでくださいね", 0.0, "カリン", 20001, 0.0);
INSERT INTO `v1_28a7c94b4e6a23f6522c35c0bc53cedc113bb85ae72dd121ce3ed551622fc0ca` VALUES (6, 20, 0, -470.0, 1, 1, 190801, "2030/12/17 14:59:59", "2015/12/17 15:00:00", 0, "いらっしゃいませ！\nＢＧＭの購入はこちらです\n素敵な曲がたくさんあって、\n目移りしちゃいますね", 0.0, "カリン", 20002, 0.0);
INSERT INTO `v1_28a7c94b4e6a23f6522c35c0bc53cedc113bb85ae72dd121ce3ed551622fc0ca` VALUES (1, 21, 0, -363.0, 1, 1, 106001, "2030/12/17 14:59:59", "2015/12/17 15:00:00", 0, "ここで手に入れたアイテムで\n専用装備を作成できるみたいね\nアイテムが集まったら\nさっそく作ってみましょ！", 0.0, "キャル", 21001, 0.0);
INSERT INTO `v1_28a7c94b4e6a23f6522c35c0bc53cedc113bb85ae72dd121ce3ed551622fc0ca` VALUES (1, 21, 0, -363.0, 1, 1, 105901, "2030/12/17 14:59:59", "2015/12/17 15:00:00", 0, "攻略すると珍しいアイテムが\n手に入りますよ\nこのアイテムで専用装備を\n作成できるようです", 0.0, "コッコロ", 21002, 0.0);
INSERT INTO `v1_28a7c94b4e6a23f6522c35c0bc53cedc113bb85ae72dd121ce3ed551622fc0ca` VALUES (1, 21, 2104010, -363.0, 1, 2, 106401, "2030/12/17 14:59:59", "2015/12/17 15:00:00", 0, "専用装備が欲しいなら\nこのクエストに挑戦するといいわ\n集めた素材でもっともっと\n強くなりましょう", 0.0, "シェフィ", 21003, 0.0);
INSERT INTO `v1_28a7c94b4e6a23f6522c35c0bc53cedc113bb85ae72dd121ce3ed551622fc0ca` VALUES (1, 21, 0, -363.0, 1, 1, 105801, "2030/12/17 14:59:59", "2015/12/17 15:00:00", 0, "専用装備の作成に必要な\nアイテムを獲得できますよ\nたくさん集めてどんどん\n強くなりましょう！", 0.0, "ペコリーヌ", 21004, 0.0);
INSERT INTO `v1_28a7c94b4e6a23f6522c35c0bc53cedc113bb85ae72dd121ce3ed551622fc0ca` VALUES (1, 22, 0, -430.0, 1, 1, 190801, "2030/12/17 14:59:59", "2015/12/17 15:00:00", 0, "投票はこちらです\nあなたが応援したい女の子に\n思いを込めた一票を\nお願いします！", 0.0, "カリン", 22001, 0.0);
INSERT INTO `v1_28a7c94b4e6a23f6522c35c0bc53cedc113bb85ae72dd121ce3ed551622fc0ca` VALUES (2, 22, 0, -430.0, 1, 1, 190801, "2030/12/17 14:59:59", "2015/12/17 15:00:00", 0, "ようこそ！\nあなたが思いを寄せるのは\nどの女の子ですか？\n応援してあげてくださいね！", 0.0, "カリン", 22002, 0.0);
INSERT INTO `v1_28a7c94b4e6a23f6522c35c0bc53cedc113bb85ae72dd121ce3ed551622fc0ca` VALUES (3, 23, 0, -430.0, 1, 1, 190801, "2030/12/17 14:59:59", "2015/12/17 15:00:00", 0, "たくさんの投票、\nありがとうございました\n結果発表を楽しみに\n待っていてくださいね！", 0.0, "カリン", 23001, 0.0);
INSERT INTO `v1_28a7c94b4e6a23f6522c35c0bc53cedc113bb85ae72dd121ce3ed551622fc0ca` VALUES (4, 23, 0, -430.0, 1, 1, 190801, "2030/12/17 14:59:59", "2015/12/17 15:00:00", 0, "ただ今、人気投票の\n集計中です\n結果が出るまでもう少しだけ\nお待ちくださいね", 0.0, "カリン", 23002, 0.0);
INSERT INTO `v1_28a7c94b4e6a23f6522c35c0bc53cedc113bb85ae72dd121ce3ed551622fc0ca` VALUES (1, 24, 0, -385.0, 2, 1, 109001, "2030/12/17 14:59:59", "2019/01/31 12:00:00", 10011, "あなた様が手伝ってくださった\nチョコレートケーキ\n美味しくないはずがありませんわ", 4.08, "エリコ（バレンタイン）", 24001, 8.0);
INSERT INTO `v1_28a7c94b4e6a23f6522c35c0bc53cedc113bb85ae72dd121ce3ed551622fc0ca` VALUES (2, 24, 0, -385.0, 2, 1, 109001, "2030/12/17 14:59:59", "2019/01/31 12:00:00", 10011, "このような失敗、あなた様が\nするはずありません\nもう一度挑戦してみましょう", 5.0, "エリコ（バレンタイン）", 24002, 8.0);
INSERT INTO `v1_28a7c94b4e6a23f6522c35c0bc53cedc113bb85ae72dd121ce3ed551622fc0ca` VALUES (3, 24, 0, -385.0, 2, 1, 109001, "2030/12/17 14:59:59", "2019/01/31 12:00:00", 10011, "あなた様のために\n作っているケーキを\nあなた様に手伝っていただく……\nことになるなんて……クスクス", 10.11, "エリコ（バレンタイン）", 24003, 8.0);
INSERT INTO `v1_28a7c94b4e6a23f6522c35c0bc53cedc113bb85ae72dd121ce3ed551622fc0ca` VALUES (4, 24, 0, -385.0, 2, 1, 109001, "2030/12/17 14:59:59", "2019/01/31 12:00:00", 10011, "あまり気に病む必要はありませんわ\nこれからは私がたっぷりと\n時間をかけて教えて差し上げますから", 4.0, "エリコ（バレンタイン）", 24004, 8.0);
INSERT INTO `v1_28a7c94b4e6a23f6522c35c0bc53cedc113bb85ae72dd121ce3ed551622fc0ca` VALUES (5, 24, 0, -385.0, 2, 1, 109001, "2030/12/17 14:59:59", "2019/01/31 12:00:00", 10011, "今回は調子が悪かった……のですか？\nあなた様が手伝ってくれたものなら\nわたしはどんなものでも……クスクス", 6.0, "エリコ（バレンタイン）", 24005, 8.0);
INSERT INTO `v1_28a7c94b4e6a23f6522c35c0bc53cedc113bb85ae72dd121ce3ed551622fc0ca` VALUES (6, 24, 0, 0.0, 1, 1, 109002, "2030/12/17 14:59:59", "2019/01/31 12:00:00", 10011, "あなた様が手がけた\nチョコレートケーキは\n私にとっての宝物……\n侮辱する者は生かしておきませんわ", 0.0, "エリコ（バレンタイン）", 24006, 0.0);
INSERT INTO `v1_28a7c94b4e6a23f6522c35c0bc53cedc113bb85ae72dd121ce3ed551622fc0ca` VALUES (7, 24, 0, 0.0, 1, 1, 109002, "2030/12/17 14:59:59", "2019/01/31 12:00:00", 10011, "とても素晴らしい出来栄えですわ！\nあなた様にふさわしい\nチョコレートケーキができました", 0.0, "エリコ（バレンタイン）", 24007, 0.0);
INSERT INTO `v1_28a7c94b4e6a23f6522c35c0bc53cedc113bb85ae72dd121ce3ed551622fc0ca` VALUES (8, 24, 0, 0.0, 1, 1, 109002, "2030/12/17 14:59:59", "2019/01/31 12:00:00", 10011, "私を手伝ってくれたあなた様は\nすでに私の虜……\n甘い世界に誘って差し上げますわ", 0.0, "エリコ（バレンタイン）", 24008, 0.0);
INSERT INTO `v1_28a7c94b4e6a23f6522c35c0bc53cedc113bb85ae72dd121ce3ed551622fc0ca` VALUES (9, 24, 0, 0.0, 1, 1, 109002, "2030/12/17 14:59:59", "2019/01/31 12:00:00", 10011, "あなた様の愛情\nしかと受け止めました\nこれが……私たちの初めての\n共同作業ですわね……クスクス", 0.0, "エリコ（バレンタイン）", 24009, 0.0);
INSERT INTO `v1_28a7c94b4e6a23f6522c35c0bc53cedc113bb85ae72dd121ce3ed551622fc0ca` VALUES (10, 24, 0, 0.0, 1, 1, 109002, "2030/12/17 14:59:59", "2019/01/31 12:00:00", 10011, "これは世界一の\nチョコレートケーキですわ\nだって、あなた様が腕によりをかけて\n作ってくださったんですもの", 0.0, "エリコ（バレンタイン）", 24010, 0.0);
INSERT INTO `v1_28a7c94b4e6a23f6522c35c0bc53cedc113bb85ae72dd121ce3ed551622fc0ca` VALUES (1, 24, 0, -385.0, 2, 1, 109101, "2030/12/17 14:59:59", "2019/01/31 12:00:00", 10011, "上手にできなくて残念だった？\nでも、弟くんの気持ちが嬉しいな\nいつだってお姉ちゃんは\nそばにいるからね♪", 2.12, "シズル（バレンタイン）", 24011, 8.0);
INSERT INTO `v1_28a7c94b4e6a23f6522c35c0bc53cedc113bb85ae72dd121ce3ed551622fc0ca` VALUES (2, 24, 0, -385.0, 2, 5, 109101, "2030/12/17 14:59:59", "2019/01/31 12:00:00", 10011, "うーん、弟くんには珍しく\n緊張しちゃったのかな？\nもう一度チャレンジしてみる？", 4.19, "シズル（バレンタイン）", 24012, 8.0);
INSERT INTO `v1_28a7c94b4e6a23f6522c35c0bc53cedc113bb85ae72dd121ce3ed551622fc0ca` VALUES (3, 24, 0, -385.0, 4, 2, 109101, "2030/12/17 14:59:59", "2019/01/31 12:00:00", 10011, "お姉ちゃんのお手伝い、\nよくできました！\nあー、\nまだつまみ食いしちゃダメだぞ！", 2.3, "シズル（バレンタイン）", 24013, 8.0);
INSERT INTO `v1_28a7c94b4e6a23f6522c35c0bc53cedc113bb85ae72dd121ce3ed551622fc0ca` VALUES (4, 24, 0, 0.0, 1, 1, 109102, "2030/12/17 14:59:59", "2019/01/31 12:00:00", 10011, "見てみて！\nスポンジに綺麗な焼き目がついてるよ\nさっすが弟くんだね！", 0.0, "シズル（バレンタイン）", 24014, 0.0);
INSERT INTO `v1_28a7c94b4e6a23f6522c35c0bc53cedc113bb85ae72dd121ce3ed551622fc0ca` VALUES (5, 24, 0, -385.0, 2, 5, 109101, "2030/12/17 14:59:59", "2019/01/31 12:00:00", 10011, "まぁまぁ、落ち込まないで\n見た目は……個性的だけど、\n味は絶対美味しいはずだから！", 5.23, "シズル（バレンタイン）", 24015, 8.0);
INSERT INTO `v1_28a7c94b4e6a23f6522c35c0bc53cedc113bb85ae72dd121ce3ed551622fc0ca` VALUES (6, 24, 0, 0.0, 1, 1, 109102, "2030/12/17 14:59:59", "2019/01/31 12:00:00", 10011, "弟くんみたいな\n可愛いケーキができたよ！\n早く食べてみたいでしょ♪", 0.0, "シズル（バレンタイン）", 24016, 0.0);
INSERT INTO `v1_28a7c94b4e6a23f6522c35c0bc53cedc113bb85ae72dd121ce3ed551622fc0ca` VALUES (7, 24, 0, -385.0, 2, 1, 109101, "2030/12/17 14:59:59", "2019/01/31 12:00:00", 10011, "あれれ？　弟くん、指に\nチョコレートがくっついてるよ？\nお姉ちゃんが舐めてあげるね、\nはぁむ！", 5.01, "シズル（バレンタイン）", 24017, 8.0);
INSERT INTO `v1_28a7c94b4e6a23f6522c35c0bc53cedc113bb85ae72dd121ce3ed551622fc0ca` VALUES (8, 24, 0, 0.0, 1, 1, 109102, "2030/12/17 14:59:59", "2019/01/31 12:00:00", 10011, "なかなか上手にできたんじゃない？\nでも弟くんはまだまだできる子！\nお姉ちゃん、信じてるからね", 0.0, "シズル（バレンタイン）", 24018, 0.0);
INSERT INTO `v1_28a7c94b4e6a23f6522c35c0bc53cedc113bb85ae72dd121ce3ed551622fc0ca` VALUES (9, 24, 0, 0.0, 1, 1, 109102, "2030/12/17 14:59:59", "2019/01/31 12:00:00", 10011, "わぁ～、\nとっても美味しそうにできたね！\n弟くん手慣れてたから\nお姉ちゃん安心して任せられちゃった！", 0.0, "シズル（バレンタイン）", 24019, 0.0);
INSERT INTO `v1_28a7c94b4e6a23f6522c35c0bc53cedc113bb85ae72dd121ce3ed551622fc0ca` VALUES (10, 24, 0, 0.0, 1, 1, 109102, "2030/12/17 14:59:59", "2019/01/31 12:00:00", 10011, "や～ん、弟くんが手伝ってくれた\nチョコレートケーキ！\nすっごく美味しそうにできたね♪", 0.0, "シズル（バレンタイン）", 24020, 0.0);
INSERT INTO `v1_28a7c94b4e6a23f6522c35c0bc53cedc113bb85ae72dd121ce3ed551622fc0ca` VALUES (1, 26, 2104010, -363.0, 1, 2, 106401, "2030/12/17 14:59:59", "2015/12/17 15:00:00", 0, "ここから先は神聖な場所みたい\nどんなお宝が眠っているのか、\n今から探索するのが楽しみね♪", 0.0, "シェフィ", 26001, 0.0);
