INSERT INTO `v1_28a7c94b4e6a23f6522c35c0bc53cedc113bb85ae72dd121ce3ed551622fc0ca` VALUES (1, 43, 0, -363.0, 1, 1, 106001, "2030/12/17 14:59:59", "2015/12/17 15:00:00", 0, "ここからアリーナに\n挑戦できるわよ！\nしっかり編成を考えて\nライバルに挑みなさい！", 0.0, "キャル", 43003, 0.0);
INSERT INTO `v1_28a7c94b4e6a23f6522c35c0bc53cedc113bb85ae72dd121ce3ed551622fc0ca` VALUES (1, 44, 0, -416.5, 1, 1, 123001, "2030/12/17 14:59:59", "2015/12/17 15:00:00", 0, "ミッションをクリアすると報酬が\n受け取れるわ。ジャンジャン\nクリアしてバリバリ強化して\nあげなさい♪", 0.0, "アメス", 43004, 0.0);
INSERT INTO `v1_28a7c94b4e6a23f6522c35c0bc53cedc113bb85ae72dd121ce3ed551622fc0ca` VALUES (2, 44, 0, -416.5, 1, 1, 123001, "2030/12/17 14:59:59", "2015/12/17 15:00:00", 0, "ぼんやりしてる場合じゃないわ。\n早くミッションをクリアして\n報酬を受け取ってきなさい！", 0.0, "アメス", 43005, 0.0);
INSERT INTO `v1_28a7c94b4e6a23f6522c35c0bc53cedc113bb85ae72dd121ce3ed551622fc0ca` VALUES (3, 45, 0, -416.5, 2, 1, 123001, "2030/12/17 14:59:59", "2015/12/17 15:00:00", 0, "ちょっとあんた、報酬が\n受け取れるじゃない！\n忘れずにチェックなさい。\nアメス様との約束よ？", 5.79, "アメス", 43006, 0.0);
INSERT INTO `v1_28a7c94b4e6a23f6522c35c0bc53cedc113bb85ae72dd121ce3ed551622fc0ca` VALUES (1, 46, 0, -371.5, 1, 1, 123001, "2030/12/17 14:59:59", "2015/12/17 15:00:00", 0, "はい、お疲れさま。\nここではマスタリーチケットを\n使って、マスタリー強化素材を\n手に入れることができるわよ。", 0.0, "アメス", 46001, 0.0);
INSERT INTO `v1_28a7c94b4e6a23f6522c35c0bc53cedc113bb85ae72dd121ce3ed551622fc0ca` VALUES (1, 47, 0, -416.5, 2, 2, 104901, "2030/12/17 14:59:59", "2015/12/17 15:00:00", 0, "呼ばれて飛び出てお姉ちゃんだよ♪\nたとえ火の中、水の中、迷宮の中っ\nこのダンジョンを踏破できるよう\n弟くんを応援してあげるからねっ♪", 0.0, "シズル", 47001, 0.0);
INSERT INTO `v1_28a7c94b4e6a23f6522c35c0bc53cedc113bb85ae72dd121ce3ed551622fc0ca` VALUES (1, 47, 0, -416.5, 2, 1, 101101, "2030/12/17 14:59:59", "2015/12/17 15:00:00", 0, "ほんとーに不思議な場所ですね～\nお兄ちゃんが冒険を頑張れるよう\nおまじないをかけてあげますねっ\nフレーフレー、お・兄・ちゃんっ♪", 9.32, "リノ", 47002, 0.0);
